INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (0, 40000, 0, 8, 36, "", 100, 0, 1, "", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107501, 40001, 0, 8, 37, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, 1, 1, "ぺコリーヌ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107601, 40001, 0, 8, 38, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, 1, 2, "コッコロ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107801, 40001, 0, 8, 39, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, 1, 3, "キャル", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107701, 40001, 0, 8, 40, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, 1, 4, "スズメ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107901, 40001, 0, 8, 41, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, 1, 5, "タマキ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107501, 40001, 0, 8, 42, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, 2, 6, "ぺコリーヌ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107601, 40001, 0, 8, 43, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, 2, 7, "コッコロ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107801, 40001, 0, 8, 44, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, 2, 8, "キャル", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107701, 40001, 0, 8, 45, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, 2, 9, "スズメ", 91002);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (107901, 40001, 0, 8, 46, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, 2, 10, "タマキ", 91002);
