INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (125801, 40011, 0, 2, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 1, 1, "リリ", 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (126001, 40011, 0, 2, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 1, 2, "クリア", 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (126101, 40011, 0, 2, 323, "んーと。\nこれ、あげる。\nはい", 1, 1, 3, "プレシア", 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (125801, 40011, 0, 2, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 2, 4, "リリ", 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (126001, 40011, 0, 2, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 5, "クリア", 24001);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (126101, 40011, 0, 2, 326, "お兄。\nきてくれて、うれしい", 1, 2, 6, "プレシア", 24001);
